  &quot;transactionItem&quot; : {
    &quot;instrument&quot; : {
      &quot;symbol&quot; : &quot;ATT&quot;
    }
  }
}]
</code></pre>
<p>I want to group the data by year and get a total sum for that year. I also want an array of the items used during the group, grouped by a field and summed, if that makes sense. This is ultimately what I want to end up with:</p>
<pre><code>{
    &quot;year&quot;: [
        {
            &quot;year&quot;: &quot;2019&quot;,
            &quot;totalYear&quot;: 14.86,
