MongoDB document returns array of key value pair in go mongo-driver<p>In our code base we have a function which merges two structs , something like below .</p>
<pre><code>func CombineStruct(s1 interface{}, s2 interface{}) error {
    data, err := json.Marshal(s1)
    if err != nil {
        return err
    }
    return json.Unmarshal(data, s2)
}
</code></pre>
<p>We use the above func to combine two structs something like below .</p>
<pre><code>m := model.SomeModel{}
CombineStruct(someStruct, &amp;m)
//above line merges two structs
</code></pre>
<p>Also currently all our structs has only <code>json</code> tags not <code>bson</code> tags yet, should we need to add <code>bson</code> tags in all the places ?</p>
<pre><code>for ex : 

type someStruct struct {
    Field1  string       `json:&quot;field1&quot;`
    Field2  string       `json:&quot;field2&quot;`
    Field3  interface{}  `json:&quot;field2&quot;`

}
</code></pre>
<p>In the above <code>someStruct</code> we have fields of type interface too!</p>
<p>Now the issue that i'm facing is wherever we combine the struct I see those object data in <code>mongoDB</code> as array of <code>key-value</code> pair something like below :</p>
<pre><code>    &quot;studentDetails&quot; : [ 
        {
            &quot;Key&quot; : &quot;Details&quot;,
            &quot;Value&quot; : [ 
                [ 
                    {
                        &quot;Key&quot; : &quot;Name&quot;,
                        &quot;Value&quot; : &quot;Bob&quot;
                    }, 
                    {
                        &quot;Value&quot; : &quot;21&quot;,
                        &quot;Key&quot; : &quot;Age&quot;
                    } 

                ]
            ]
        }, 
        {
            &quot;Key&quot; : &quot;Enrolled&quot;,
            &quot;Value&quot; : false
        } 

    ],
</code></pre>
<p>But I want this to be displayed like something like below . Not like <code>key-value</code> pair.</p>
<pre><code>    &quot;studentDetails&quot; : {
        &quot;Details&quot; : [ 
            {
                &quot;name&quot; : &quot;serverdr&quot;,
                &quot;age&quot; : 21

            }, 
            {
                &quot;Enrolled&quot; : false

            }
        ],
</code></pre>
<p>It was displaying objects like above way in our old global sing <a href="https://pkg.go.dev/github.com/globalsign/mgo" rel="nofollow noreferrer">mgo</a> driver .But using the new <a href="https://pkg.go.dev/go.mongodb.org/mongo-driver/mongo" rel="nofollow noreferrer">go-mongo</a> driver when we combine two structs using the <code>CombineStruct()</code> function it <code>displays</code> as array of key value pair.</p>

