I want logged-in users to be able to add/remove expenses and not show their expenses to other users but I don't know how I can implement that. I am not asking for code- I would be grateful if you could roughly tell me what I need to do. Thanks!</p>
<pre><code>//expense schema
const expenseSchema = new mongoose.Schema(
    {
        date: Date,
        detail: String,
        amount: Number,
        category: String
    }
)
</code></pre>
<pre><code>//controller for adding expenses
const addExpenseController =     (req, res) =&gt; {
    const expense = new Expense({
        &quot;date&quot;: new Date(),
        &quot;amount&quot;: req.body.amount,
        &quot;detail&quot;: req.body.detail,
        &quot;category&quot;: &quot;expense&quot;
    });
    expense.save();

    res.send('expense added');
};
</code></pre>

